import React from 'react'

const NAME = 'NAME'

let initialState={
    name: ''
}


export const reducerStateName=(state = initialState, action)=>{
    switch(action.type){
        case NAME:{
            return {...state, name:action.name}
        }
        default:
            return state
    }
}

export const Name=(name)=>({type: NAME, name})
